import mongoose from "mongoose";

const DB_CONNECTION_URL = "mongodb+srv://nayeemhoque109:4Sv31J5RGxMhp9JO@cluster0.9cqzymw.mongodb.net/?retryWrites=true&w=majority&appName=Cluster0";

